GBF-TARGET-15Description:
Pran mezi legal, administratif oswa politik pou ankouraje ak pèmèt biznis, ak an patikilye asire ke gwo ak transnasyonal konpayi yo ak enstitisyon finansye: 

(a) Regilyèman kontwole, evalye, ak transparan divilge risk yo, depandans ak enpak sou divèsite divèsite, ki gen ladan ak kondisyon pou tout gwo kòm byen ke konpayi transnasyonal ak enstitisyon finansye ansanm operasyon yo, ekipman pou ak chenn valè ak pòtfolyo;

(b) Bay enfòmasyon ki nesesè pou konsomatè pou ankouraje modèl konsomasyon dirab; 

(c) Rapò sou konfòmite avèk aksè ak benefis-pataje règleman ak mezi, jan sa aplikab;

yo nan lòd yo progresivman diminye enpak negatif sou divèsite divèsite, ogmante enpak pozitif, diminye risk ki gen rapò ak biodiversite-nan biznis ak enstitisyon finansye, ak ankouraje aksyon asire modèl dirab nan pwodiksyon.

GBF-TARGET-19Description:
Substansyèlman ak progresivman ogmante nivo resous finansye ki soti nan tout sous, nan yon fason efikas, alè ak fasil aksesib, ki gen ladan resous domestik, entènasyonal, piblik ak prive, an akò ak Atik 20 nan Konvansyon an, pou aplike estrateji nasyonal divèsite divèsite ak plan aksyon, pa 2030 mobilize omwen 200 milya dola Etazini chak ane, ki gen ladan pa:

(a) Ogmante total divèsite divèsite ki gen rapò resous finansye entènasyonal soti nan peyi devlope, ki gen ladan asistans devlopman ofisyèl, ak nan peyi ki volontèman asime obligasyon nan peyi devlope Pati, nan peyi devlope yo, an patikilye peyi yo pi piti devlope ak ti zile eta devlope, osi byen ke peyi ki gen ekonomi nan tranzisyon, omwen US $20 milya dola pa 2025, ak nan omwen US $30 milya dola pa ane pa 2030;

(b) Siyifikativman ogmante mobilizasyon resous domestik, fasilite pa preparasyon ak aplikasyon plan finans divèsite divèsite nasyonal oswa enstriman mizik ki sanble dapre bezwen nasyonal, priyorite ak sikonstans;

(c) Eflase finans prive, fè pwomosyon finans melanje, mete ann aplikasyon estrateji pou ogmante nouvo ak resous adisyonèl, ak ankouraje sektè prive a envesti nan divèsite divèsite, ki gen ladan atravè fon enpak ak lòt enstriman mizik;

(d) Enstile konplo inovatè tankou peman pou sèvis ekosistèm, lyezon vèt, offsets divèsite divèsite ak kredi, mekanis benefis-pataje, ak sekirite anviwònman ak sosyal;

(e) Optimize ko-benefis ak sinèrji nan finans vize divèsite divèsite yo ak kriz klima;

(f) Amelyore wòl aksyon kolektif, ki gen ladan pa pèp endijèn ak kominote lokal yo, Manman Latè aksyon santre [1] ak apwòch ki pa baze sou mache ki gen ladan jesyon resous natirèl kominote ki baze sou ak koperasyon sosyete sivil ak solidarite ki vize a konsèvasyon nan divèsite divèsite divèsite;

(g) Amelyore efikasite, efikasite ak transparans nan dispozisyon resous ak itilizasyon.

***

[1] Manman Latè-santre aksyon: Ekosantrik ak dwa ki baze sou apwòch pèmèt aplikasyon an nan aksyon nan direksyon pou relasyon Harmony ak konplemantè ant pèp ak lanati, pwomosyon kontinwite a nan tout èt vivan ak kominote yo ak asire ki pa komodifikasyon nan fonksyon anviwònman nan Manman Latè.
